import {ActionInterface, Reducer} from "./interfaces";

export default (state:Reducer, action:ActionInterface) => {
    switch (action.type) {
        case  'SET_MOVIES':
            return {
                ...state,
                users: action.payload.users,
            }
        default:
            return state;
    }
}
